            borderWidth: 1,
            borderColor: 'black',
            borderRadius: 5,
            alignItems: 'center',
            justifyContent: 'center',
            padding: 10,
            cursor: 'pointer',
        }
    }

    return (
       <div style={styles.container} key={index} onClick={()=>{cardClick(movie.imdb_code)}}>
            <img 
                src={`${movie.medium_cover_image}`} 
                width={180}
                height={280}
            />
